import React from 'react';
import Header from "../components/Header";
import pc from "./../assets/pc.png";
import '../index.css';

function HomePage() {
  return (
    <>
      <Header/>
      <div className="bg-bluenav  cont">
    
    
        <p className="text-5xl text-white mt-32 mx-14"> Build your own Dream Pc. </p>
        <br></br>   <p className="text-2xl text-white mt-32 mx-14">Are you looking for a new desktop but does the current<br></br> offer not entirely match your wishes? Or are you looking<br></br> for a custom made desktop? Circles offers a place to<br></br> choose amongst the best components in the market <br></br>for you to build your own desktop!</p>
        <img src={pc} width="500"  height="500" className="image"></img>
      
      </div>
    </>
  );
}

export default HomePage;
